async () => {
  if (appsmith.store.selectedTitle === undefined) {
    return [];
  }
  var temp = await chess_com_titled_players.run();
  var res = temp.players;
  var tabledata = [];
  for (let i = 0; i < res.length; i++) {
    var data = {};
    data["name"] = res[i];
    data["action"] = "";
    tabledata.push(data);
  }
  return tabledata;
}

